
def solution(msg):
    answer = []
    li = [chr(x) for x in range(64,91)]

    while True:
        for i in range(len(msg),0,-1):
            x = msg[:i]
            if x in li:
                idx = li.index(x)
                answer.append(idx)
                msg = msg[i:]
                if msg:
                    tmp = x+msg[0]
                    li.append(tmp)
                break
        #print(li,msg)
        if len(msg) <= 0:
            break
    return answer

